/* Pallete to test new combinations with
	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: rgba(159, 165, 177, 0.6);
  padding: 5px;
  border-bottom: 1px solid #1b1d22;
  display: flex;
  align-items: center;
}
.github-Accordion-header::-webkit-details-marker {
  color: rgba(159, 165, 177, 0.6);
}
.github-Accordion--rightTitle,
.github-Accordion--leftTitle {
  flex: 1;
}
.github-Accordion-content {
  border-bottom: 1px solid #1b1d22;
  background-color: #2e3138;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: rgba(159, 165, 177, 0.6);
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #d8dadf;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid #1b1d22;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #373b44;
}
